import React, { useEffect, useState } from "react";

const Home = () => {

  const [dict, setDict] = useState([]);
  const getDict = async () => {
    try {
      const response = await fetch("http://localhost:5000");
      const jsonData = await response.json();
      setDict(jsonData);
      console.log(dict);
    } catch (err) {
      console.error(err.message);
    }
  };


  console.log();
  useEffect(() => {
    getDict();
  }, []);


  return (
    <div>
      <h1>HOME</h1>
      <div></div>
    </div>
  );
};

export default Home;
